import React, { useState, useEffect } from "react";
import { FaBars } from "react-icons/fa";
import {
  Nav,
  NavbarContainer,
  NavLogo,
  MobileIcon,
  NavMenu,
  NavItem,
  NavLinks,
  NavButton,
  NavButtonLink,
  NavItemResume,
} from "./NavbarElement";
import { animateScroll as scroll } from "react-scroll";
import logo from "../../image/logo.png";

const Navbar = ({ toggle }) => {
  const [ScrollNav, SetScrollNav] = useState(false);

  const changeNav = () => {
    if (window.scrollY >= 80) {
      SetScrollNav(true);
    } else {
      SetScrollNav(false);
    }
  };

  useEffect(() => {
    window.addEventListener("scroll", changeNav);
  }, []);

  const toggleHome = () => {
    scroll.scrollToTop();
  };
  return (
    <>
      <Nav>
        <NavbarContainer scrollNav>
          <NavLogo to="/">
            <img onClick={toggleHome} src={logo} alt="logo" />
            {/* <p>CalvinHacks</p> */}
          </NavLogo>
          <MobileIcon onClick={toggle}>
            <FaBars />
          </MobileIcon>
          <NavMenu>
            <NavItem>
              <NavLinks
                to="about"
                smooth={true}
                duration={500}
                spy={true}
                exact="true"
                offset={-80}
              >
                About
              </NavLinks>
            </NavItem>
            <NavItem>
              <NavLinks
                to="faq"
                smooth={true}
                duration={500}
                spy={true}
                exact="true"
                offset={-80}
              >
                FAQ
              </NavLinks>
            </NavItem>
            <NavItem>
              <NavLinks
                to="schedule"
                smooth={true}
                duration={500}
                spy={true}
                exact="true"
                offset={-80}
              >
                Schedule
              </NavLinks>
            </NavItem>
            <NavItem>
              <NavLinks
                to="Sponsors"
                smooth={true}
                duration={500}
                spy={true}
                exact="true"
                offset={-80}
              >
                Sponsors
              </NavLinks>
            </NavItem>
            <NavItemResume to="/Resume">Resume</NavItemResume>
            {/* TODO: My changes */}
            <NavItemResume to="">Submit your project</NavItemResume>
            <NavButton>
              <NavButtonLink to="/signin">Log in</NavButtonLink>
            </NavButton>
            {/* TODO: My changes */}
          </NavMenu>
        </NavbarContainer>
      </Nav>
    </>
  );
};

export default Navbar;
